import React from 'react';
import about from '../css/about.css';

class About extends React.Component {
  render() {
    return(
      <section id="about-section">
        <div className="about-us-container">
          <h1 className="about-us"> About Us </h1>
        </div>
      </section>
    );
  };
};

export default About;
